import React, {useState,Component } from "react";
import '../App.css'
import { Card, Container,Nav,Button,Form } from "react-bootstrap";
import Header from '../components/Header';
import {useHistory} from 'react-router-dom';

export default class DoctorLogin extends Component {
  constructor(props) {
    super(props);

    this.state = {
      doctor_id: "",
      password: "",
      loginErrors: ""
    };

    this.handleSubmit = this.handleSubmit.bind(this);
    this.handleChange = this.handleChange.bind(this);
  }

  handleChange(event) {
    this.setState({
      [event.target.name]: event.target.value
    });
  }

  handleSubmit(event) {
    const { doctor_id, password } = this.state;

    axios
      .post(
        "http://localhost:3001/doctorLogin",
        {
          user: {
            doctor_id: doctor_id,
            password: password
          }
        },
        { withCredentials: true }
      )
      .then(response => {
        if (response.data.logged_in) {
          this.props.handleSuccessfulAuth(response.data);
        }
      })
      .catch(error => {
        console.log("login error", error);
      });
    event.preventDefault();
  }
   return(){ 
    return(
        <div>
             <Header />
        <Container fuild="xl">
            <Card className="myCard">
  <Card.Header>
    <Nav variant="tabs">
      <Nav.Item>
        <Nav.Link href="/AdminLogin" >Admin</Nav.Link>
      </Nav.Item>
      <Nav.Item>
        <Nav.Link href="/VCLogin">Vaccination Center</Nav.Link>
      </Nav.Item>
      <Nav.Item>
        <Nav.Link href="/VerificationLogin" >
          Verification Center
        </Nav.Link>
      </Nav.Item>
      <Nav.Item>
        <Nav.Link href="/VerifierLogin">
          Verifier
        </Nav.Link>
      </Nav.Item>
      <Nav.Item>
        <Nav.Link href="/DoctorLogin" active >
          Doctor
        </Nav.Link>
      </Nav.Item>
    </Nav>
  </Card.Header>
  <Card.Body>
    <Card.Title className="cardTitle">Doctor Login</Card.Title>
    <Card.Text>
    <Form onSubmit={this.handleSubmit}>
  <Form.Group controlId="formBasicIDl">
    <Form.Label className="formLabel">Doctor-id</Form.Label>
    <Form.Control type="text" name="doctor_id" value={this.state.doctor_id}
            onChange={this.handleChange} placeholder="Enter ID" />
    
  </Form.Group>

  <Form.Group controlId="formBasicPassword">
    <Form.Label className="formLabel">Password</Form.Label>
    <Form.Control type="password" name="password" value={this.state.password}
            onChange={this.handleChange}  placeholder="Password" />
  </Form.Group>
  
</Form>
    </Card.Text>
    <Button  className="loginBtn" variant="primary">Login</Button>
  </Card.Body>
</Card>
        </Container>
        </div>
    )
}
}
